const MainTemplate: React.FC<MainTemplateProps> = (props) => {
  const { state } = props;

  return (
    <MainTemplate
      title={"ここのところとか"}
      content={
        <InformationContent
          items={[
            {
              icon: <Icon />,
              marginBottom: "15px",
            },
            {
              message: "めせーじ",
              large: true,
            },
            {
              icon: <LoaderBar />,
            },
          ]}
        />
      }
      state={state}
    />
  );
};

const StyledMainTemplate = styled.div`
  background: red;
  height: 200px;
`;

export default MainTemplate;
